-------------------------------------
	-- SELL CALCULATION PRICE --
------------------------------------- 
-- DOLLARS --
Config.DYNAMIC_PRICE_CALCULATION_FORMULA 			= false -- IF TRUE THE SELLING PRICE AT STABLE WILL BE BASED ON THE FORMULA BELOW:
--(PURCHASE DOLLAR PRICE * Config.DOLLARS_MULTIPLIER) + (HORSE XP * Config.XP_MULTIPLIER)  * STABLE PRICE MULTIPLIER
Config.DOLLARS_MULTIPLIER  			= 0.9
Config.XP_MULTIPLIER    			= 0.4
-- FOR EXAMPLE IF YOU BOUGHT A HORSE $100 AND IT HAS 200 XP THEN IT WILL BE : (100 * 0,9) + (200 * 0.4)
-- IF Config.DYNAMIC_PRICE_CALCULATION_FORMULA = false it will be this formula : ((PURCHASE DOLLAR PRICE / Config.PRICE_DIVIDER))
Config.PRICE_DIVIDER    			= 10000
 
-- GOLD (ONLY FOR VORP) --
Config.GOLD_VORP_ENABLED              = false -- (FOR VORP ONLY) ENABLE OR DISABLE GOLD CURRENCY

--(PURCHASE GOLD PRICE * Config.GOLD_MULTIPLIER) + (HORSE XP * Config.GOLD_XP_MULTIPLIER)
Config.GOLD_DYNAMIC_PRICE 			  = false -- IF TRUE THE GOLD SELLING PRICE AT STABLE WILL BE BASED ON THE FORMULA BELOW:
Config.GOLD_MULTIPLIER                = 0.5
Config.GOLD_XP_MULTIPLIER             = 0.001

--IF CONFIG.GOLD_DYNAMIC_PRICE == FALSE IT WILL BE THIS FORMULA : ((GOLD/CONFIG.GOLD_DIVIDER))
Config.GOLD_DIVIDER    				  = 10000

 

